import React from "react";
import styled from "styled-components";
const Card = ({props}) => {
  return (
    <>
      <Wrapper>
        <div className="card">
          <div className="card_body">
            <div className="star_icon">{props.star}</div>
            <div className="card_description"></div>
            <div className="grid_two_columns">
              <h3 className="card_title">anna</h3>
              <p>icon</p>
            </div>
          </div>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.div``;
export default Card;
